import React from "react";
import Container from 'react-bootstrap/Container';
import Nav from 'react-bootstrap/Nav';
import Navbar from 'react-bootstrap/Navbar';
import NavDropdown from 'react-bootstrap/NavDropdown';



const Header = () => {
  return (
    <Navbar bg="dark" data-bs-theme="dark" collapseOnSelect expand="lg" className="bg-body-tertiary">
    <Container>
      <Navbar.Brand href="#home">DVM</Navbar.Brand>
      <Navbar.Toggle aria-controls="responsive-navbar-nav" />
      <Navbar.Collapse id="responsive-navbar-nav">
        <Nav className="me-auto">
          <Nav.Link href="/">Часто обсуждаемое</Nav.Link>
          <Nav.Link href="/user">Жалобы</Nav.Link>
          <Nav.Link href="#й"></Nav.Link>
          <NavDropdown title="Инициативы" id="collapsible-nav-dropdown">
            <NavDropdown.Item href="#action/3.1">Предложить инициативу</NavDropdown.Item>
            <NavDropdown.Item href="#action/3.2">Жалобы</NavDropdown.Item>
          </NavDropdown>
        </Nav>
        <Nav>
          <Nav.Link href="/user">Account</Nav.Link>
          <Nav.Link eventKey={2} href="#">
            Dank memes
          </Nav.Link>
        </Nav>
      </Navbar.Collapse>
    </Container>
  </Navbar>
  )
}

export default Header;
